    "pests0" : MessageLookupByLibrary.simpleMessage("1. The cane beetle (also known as cane grub) can substantially reduce crop yield by eating roots; it can be controlled with imidacloprid (Confidor) or chlorpyrifos (Lorsban).\n 2. Other important pests are the larvae of some butterfly/moth species, including the turnip moth, the sugarcane borer (Diatraea saccharalis), the African sugarcane borer (Eldana saccharina), the Mexican rice borer (Eoreuma loftini), the African armyworm (Spodoptera exempta), leaf-cutting ants, termites, spittlebugs (especially Mahanarva fimbriolata and Deois flavopicta), and the beetle Migdolus fryanus.\n 3. The planthopper insect Eumetopina flavipes acts as a virus vector, which causes the sugarcane disease ramu stunt."),
    "pests1" : MessageLookupByLibrary.simpleMessage("1. Only use certified disease-free seeds and plants.\n 2. Avoid areas that were planted with peppers or tomatoes during the previous year.\n 3. Avoid overhead watering by using drip or furrow irrigation. Remove and dispose of all diseased plant material. \n 4. Prune plants to promote air circulation. Spraying with a copper fungicide will give fairly good control of the bacterial disease. Follow the instructions on the label. See Table 1 for fungicide products for home garden use."),
    "pests2" : MessageLookupByLibrary.simpleMessage("1. Plant only certified seed potatoes - certified seed potatoes are grown in seed beds with zero tolerance of ring rot; remove all crop debris from soil after harvest; sanitize tools and equipment regularly.\n2.Plant potato in well-draining soils with no history of pink rot; avoid overwatering plants; avoid wounding during harvest."),
    "pests3" : MessageLookupByLibrary.simpleMessage("1. Treat seeds with appropriate fungicide prior to planting to reduce rot in mature bulbs; avoid bruising bulbs during and after harvest; storing at temeperatures below 15°C (59°F) prevents mold from spreading but it will resume once temperature increases"),
    "pests4" : MessageLookupByLibrary.simpleMessage("1. Avoid planting seed from infected fields; avoid overhead irrigation; plant less susceptible cultivars.\n2. Avoid planting seed from plants grown in fields where the disease is known to be present"),
    "pests5" : MessageLookupByLibrary.simpleMessage("1. Encourage natural enemies. Keep the field free from crop debris and weeds. Spraying strong jet of water to dislodge the aphid. If infestation is severe spray suitable insecticide."),
    "pests6" : MessageLookupByLibrary.simpleMessage("1. Fumigation may be necessary in soils known or suspected to have carried the disease.\n2. Use pathogens free planting material; if disease is present prune out dead and infected wood and plow under soil; apply an appropriate fungicide"),
    "pests7" : MessageLookupByLibrary.simpleMessage("1. Avoid planting in poorly draining, cool, wet soil.\n2. Planting in raised beds will help with soil drainage.\n3. Plant high quality seed that germinates quickly.\n4. Treat seeds with fungicide prior to planting to eliminate fungal pathogens."),
    "pests8" : MessageLookupByLibrary.simpleMessage("1.Plant resistant varieties; plant only disease-free seed; disinfect all tools and equipment regularly; avoid sprinkler irrigation. 2.Plant resistant varieties if nematodes are known to be present in the soil ;check roots of plants mid-season or sooner if symptoms indicate nematodes; solarizing soil can reduce nematode populations in the soil and levels of inoculum of many other pathogens."),
    "pests9" : MessageLookupByLibrary.simpleMessage("1.Infected areas of trees should be pruned out beginning just below the canker. 2.Applications of hoticultural oils or sulfur sprays are effective at controlling blister mites and should be applied if the mites were a problem the previous year; chemical treatments should be applied before bloom."),
